import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import Navbar from "../Navbar/Navbar.jsx";
import Footer from "../Footer/Footer.jsx";
import { useAuth } from "../../Context/userContext.js";
import getTasks from "../../REDUX/Actions/getTasks.js";
import css from "./Profile.module.css";

export default function Profile() {
  const { user } = useAuth();
  const dispatch = useDispatch();
  console.log(user);

  const tasks = useSelector((state) => state.tasks);
  console.log(tasks);

  useEffect(() => {
    dispatch(getTasks());
  }, []);

  const handleSubmit = (e) => {
    e.preventDefault();

    const { email, password } = e.target;

    const userData = {
      email: email.value,
      password: password.value
    };

    if ( userData.email === "" || userData.password === "") {
      return alert("You must complete all fields");
    }

   signin(userData)
  };

  return (
    <div className={css.container}>
      <Navbar></Navbar>
      <div className={css.containerForm}>
        <div className={css.form}>
          <form onSubmit={handleSubmit} className={css.formulario}>
            <input type="string" placeholder="Title..." name="title" />
            <input
              type="string"
              placeholder="Description..."
              name="description"
            />
            <button type="submit"> Create task</button>
          </form>
        </div>
      </div>

      <div className={css.containerTask}>
        tasks
        {tasks ? tasks.title : <h1>no hay nadie logueado</h1>}
      </div>

      <Footer></Footer>
    </div>
  );
}
